import React from 'react';
import { Link } from 'react-router-dom';

function Landing() {
  const styles = {
    container: {
      maxWidth: '400px',
      margin: '3rem auto',
      padding: '2rem',
      borderRadius: '12px',
      backgroundColor: 'rgba(255, 255, 255, 0.85)', // slight translucency for a modern feel
      boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)', // softer shadow
      textAlign: 'center'
    },
    heading: {
      color: 'var(--secondary-color)', // using CSS variable for consistency
      marginBottom: '1.5rem',
      fontWeight: '600'
    },
    button: {
      width: '100%',
      padding: '12px',
      marginTop: '1rem',
      borderRadius: '20px',
      border: 'none',
      backgroundColor: 'var(--primary-color)', // consistent button color
      color: '#fff',
      fontSize: '1rem',
      cursor: 'pointer',
      transition: 'background-color 0.3s ease'
    }
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.heading}>Welcome to StudBuds</h1>
      <p>Your study buddy matching app.</p>
      <Link to="/login">
        <button style={styles.button}>Log In</button>
      </Link>
      <Link to="/signup">
        <button style={styles.button}>Sign Up</button>
      </Link>
    </div>
  );
}

export default Landing;
